STYLEMODEL_INJECT = ""
for _k,l in pairs(MODELS) do
	INACTIVE_INJECT = ""
	if INACTIVE then INACTIVE_INJECT = l["Filename"] 
end
	STYLEMODEL_INJECT = STYLEMODEL_INJECT .. [[
        <Property value="GcBaseBuildingPartStyleModel.xml">
          <Property name="Inactive" value="TkModelResource.xml">
            <Property name="Filename" value="]] .. INACTIVE_INJECT .. [[" />
			<Property name="ResHandle" value="GcResource.xml">
			  <Property name="ResourceID" value="0" />
			</Property>
          </Property>
          <Property name="Model" value="TkModelResource.xml">
            <Property name="Filename" value="]] .. l["Filename"] .. [[" />
			<Property name="ResHandle" value="GcResource.xml">
			  <Property name="ResourceID" value="0" />
			</Property>
          </Property>
          <Property name="Style" value="GcBaseBuildingPartStyle.xml">
            <Property name="Style" value="]] .. l["Style"] .. [[" />
          </Property>
        </Property>
]]
end
return [[
    <Property value="GcBaseBuildingPart.xml">
      <Property name="ID" value="]] .. ID .. [[" />
      <Property name="StyleModels">
	  ]] .. STYLEMODEL_INJECT .. [[
      </Property>
    </Property>
]]
end

function GetSpecials(ID)
return [[
    <Property value="GcPurchaseableSpecial.xml">
      <Property name="ID" value="]] .. ID .. [[" />
      <Property name="ShopNumber" value="1" />
      <Property name="MissionTier" value="-1" />
      <Property name="IsConsumable" value="False" />
    </Property>
]]
end

function GetLanguageEntry(NAME, VALUE, LOCALE)
return[[
    <Property value="TkLocalisationEntry.xml">
      <Property name="Id" value="]] .. NAME .. [[" />
      <Property name="]] .. LOCALE .. [[" value="]] .. VALUE .. [[" />
    </Property>
]]
end

